INSERT INTO `users_recommendation` VALUES (9,23,1028,'Уважаемый Иван!<bR><bR>Милый, я тебе клянусь,<bR>От любви к тебе рехнусь!',1487186986,'clean'),(13,23,1030,'Уважаемый Иван!<bR><bR>Благодарю Вас за охуенное с1нисхождение, оказанное мне в начале моей карьеры, за некоторые незначительные поблажки, на совершенные мной автоматические ошибки, за веру в мой проект и за возможность самореализации.',1487191397,'clean'),(25,1030,23,'Уважаемый Михаил!<bR><bR>Выражаю глубокую признательность и благодарность за Ваше профессиональное мастерство, талант, душевную щедрость.Особенно хочется Вас поблагодарить за индивидуальный подход, компетентность, ответственность и доброжелательность.Вы умный, талантливый, неповторимый профессионал своего дела!<bR>Спасибо за все, что Вы делаете, и благодарю Вас за творческое отношение к работе, энтузиазм, открытость и доброжелательность!',1488159736,'unknown'),(29,23,1030,'Уважаемый Иван!<bR><bR>Я считаю, что ты охуенный профессиональные навыки и личностные качества сотрудника позволяют мне рекомендовать его для дальнейшей работы в аналогичной сфере деятельности, и я надеюсь, что приобретенный опыт работы позволит ему и далее быть востребованным специалистом. Желаю ему дальнейших успехов в профессиональной сфере.',1488163435,'clean'),(30,1028,23,'Уважаемый Наталья!<bR><bR>Я считаю, что Ваши профессиональные навыки и личностные качества позволяют мне рекомендовать Вас для дальнейшей работы в аналогичной сфере деятельности, и я надеюсь, что приобретенный опыт работы позволит Вам и далее быть востребованным специалистом. Желаю ему дальнейших успехов в профессиональной сфере.',1508336349,'clean');
